import React, { Component } from "react"
import logo from './hali.jpg';

class Town extends Component {
    constructor(props) {
        super(props)
        this.state = {
            lastestDate: '',
            totalCases: '',
            totalDeaths: '',
            totalVaccinated: '',
            changeCases: '',
            changeDeaths: ''
        }
        this.fetchData = this.fetchData.bind(this);
    }
