                    being the only month with a high that is slightly below freezing at â0.1 Â°C (31.8 Â°F),
                    while August is the warmest. The sea heavily influences the climate of the area,
                    causing significant seasonal lag in summer, with August being significantly warmer than June and with September being the third mildest month in terms of mean temperature.[20]
                    The January mean is only 1.1 Â°C (2.0 Â°F) colder than the isotherm for the oceanic climate.
                    </p>


                <p><b>Lastest Date: </b>{this.state.lastestDate}</p>
                <p><b>Total Cases: </b>{this.state.totalCases}</p>
